};


function App(){

    return (
        <div className='app'>
            <main>
                <div className="search-box">
                    <input
                        type="text"
                        className="search-bar"
                        placeholder="search...."
                    />
                </div>
                <div className="location-box">
                    <div className="location">NewYork City,Us</div>
                    <div className="date">{dateBuilder(new Date())}</div>
                </div>
            </main>

        </div>
    )
}

export default App;
